import './Tasks.css'
import Task from './Task/task'
import axios from 'axios'
import React from "react"

const Tasks = () => {

	const displayTasks = () => {
		axios.get('http://192.168.1.37:8080/db').then(res => {
			res.data.map(task => {
				return ( <Task /> )
			})
		})
	}

const [tasks,setTasks] = React.useState(null)

setTasks(displayTasks())

	return (
		<>{tasks}</>
	)
}

export default Tasks
